import React from 'react';
import {Redirect} from 'react-router-dom';

export const AcademyAppConfig = {
    settings: {
        layout: {}
    },
    routes  : [
        {
            path     : '/academy/crp/CourseOffer',
            component: React.lazy(() => import('./crp/tabs/CourseInstructor.js'))
        },
        {
            path     : '/academy/course/:courseId/:courseName',
            component: React.lazy(() => import('./course/StudentCoursePage'))
        },
        {
            path     : '/academy/courses',
            component: React.lazy(() => import('./courses/Courses'))
        },

        {
            path     : '/academy/crp/sheetupload',
            component: React.lazy(() => import('./crp/tabs/GmailService.js'))
        },

        {
            path     : '/academy/crp/PendingWork/:courseId',
            component: React.lazy(() => import('./crp/tabs/PendingWork/RequestList.js'))
        },
        {
            path    :`/academy/crp/pastOfferingDetails/:offeringId`, 
            component: React.lazy(() => import('./crp/PastOfferingPage.js'))
        },
        {
            path    :`/academy/crp/courseDetails/:offeringId`, 
            component: React.lazy(() => import('./crp/CoursePage.js'))
        },

        {
            path: '/academy/crp/admin', 
            component: React.lazy(()=> import('./crp/admin/AdminPage.js'))
        },
        {
            path: '/academy/crp/hod', 
            component: React.lazy(()=> import('./crp/hod/HodPage.js'))
        },
        {
            path    :'/academy/crp',
            component: React.lazy(() => import('./crp/CourseRegistrationPortal'))
        },        
        {
            path     : '/academy',
            component: React.lazy(() => import('./AcademyPage/AcademyPage'))
        } 



    ]
};
